import React from 'react';
import Product from './Product';

const ProductList = ({ products }) => {
  return (
    <main>
      <ul>
        {products.map(({ name, category, img, price }) => (
          <Product
            key={id}
            name={name}
            category={category}
            image={img}
            price={price}
          />
        ))}
      </ul>
    </main>
  );
};

export default ProductList;
